script: |
  super -f text -I q7612.spq | sort > q7612.out

inputs:
  - name: q7612.spq
    data: |
      SELECT 26 * + - col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN + 91 + - 9 + + col1 + + col0 * + col1 + col0 + - - col0 * 8 AND - - ( - 78 );
  - name: tab1

outputs:
  - name: q7612.out
    data: |
